import React from 'react'
import styled from 'styled-components'

const Slide_T=() =>{

    return(
        <Box_slide>
            <div className="item">
                <div className="img_item">

                </div>
                
            </div>
        </Box_slide>
    );

}

const Box_slide = styled.div`
    height:100%;
    display:flex;
    flex-direction:column;
    justify-content: center;
`

export default Slide_T
